import React from 'react';

export default function Ctfoot() {

  return (
    <div style={{ paddingTop: "1px", paddingLeft: "35%" , marginTop: "-100px" }}>
      <a href="google.com" style={{ color: "blue" }}>
        Privacy Policy
      </a>
      &nbsp;
      <span style={{ color: "black" }}>
        | &#169; 2023 HighRadius Corporation. All rights reserved.
      </span>
    </div>
  );
}
